import React from "react";
import "./footer.css";

function Footer() {
  return (
    <footer>
      <div className="footer">
        <div className="kurumsal">
          <h3>Kurumsal</h3>
          <ul className="list-style-none mt-5">
            <li>Hakkımızda</li>
            <li>Sürdürülebilirlik</li>
            <li>İnsan Kaynakları</li>
            <li>Haberler</li>
            <li>İletişim</li>
          </ul>
        </div>
        <div className="hizmetlerimiz">Hizmetlerimiz</div>
        <div className="magazalar">Mağazalar</div>
        <div className="gizlilik">Gizlilik</div>
        <div className="sosyal">Bizi Takip Edin</div>
      </div>
    </footer>
  );
}

export default Footer;
